import React, { Component } from 'react';
import './App.css';

var resultados = []

class App extends Component {
constructor(){
  super()
  this.state={
    filtrado: false
  }
}

fileHandler(e){
    const input = document.querySelector('input[type="file"]')

    if(input!= null){
      let reader = new FileReader()
      reader.readAsText(input.files[0])
      reader.onload = ()=>{
          const lines = reader.result.split('\n').map((line)=>{
              if(typeof line != undefined){
                  return { 
                      usuario:line.split(';')[0],
                      data: new Date(this.convertDate(line.split(';')[1]))
                  }
              }else{
                return ''
              }

          })
          this.filterUser(lines)


      }

    }

}

filterUser(lines){
    lines.forEach((obj)=>{
      if(Object.keys(obj).length == 0){
       if(obj.usuario in this.state.resultados){
            if(this.state.resultados[obj.usuario].getTime() < obj.data.getTime()){
                resultados[obj.usuario] = obj.data
            }
        }else{
            resultados[obj.usuario] = obj.data
        }
      }
    })
}

convertDate(string){
    //Padrão de entrada = dd/mm/yyyy
    if(string){
        let dia = string.split('/')[0]
        let mes = string.split('/')[1]
        let ano = string.split('/')[2]

        return [ano, mes, dia];
    }
}

  render() {
    return (
      <div className="App">
        <input type="file" onChange={(e)=>this.fileHandler(e)}></input>
      </div>
    )
  }
}

export default App;
